
public class Operator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num1=100;
		int num2=100;
		if(num1<=50 && ++num1>=101)
		{
			System.out.println("True");
		}
		if(num2>=50 && ++num2>=101)
		{
			System.out.println("True");
		}
			System.out.println(num1);
			System.out.println(num2);
	}

}
